read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        rows -> merge_msg_rows(Prev, New, TrUserData);
        column_schema -> merge_msg_column_schema(Prev, New, TrUserData);
        row -> merge_msg_row(Prev, New, TrUserData);
        value -> merge_msg_value(Prev, New, TrUserData);
        list_value -> merge_msg_list_value(Prev, New, TrUserData);
        struct_value -> merge_msg_struct_value(Prev, New, TrUserData);
        query_context -> merge_msg_query_context(Prev, New, TrUserData);
        snapshot_sequences -> merge_msg_snapshot_sequences(Prev, New, TrUserData);
        explain_options -> merge_msg_explain_options(Prev, New, TrUserData);
        request_header -> merge_msg_request_header(Prev, New, TrUserData);
        response_header -> merge_msg_response_header(Prev, New, TrUserData);
        status -> merge_msg_status(Prev, New, TrUserData);
        auth_header -> merge_msg_auth_header(Prev, New, TrUserData);
        basic -> merge_msg_basic(Prev, New, TrUserData);
        token -> merge_msg_token(Prev, New, TrUserData);
        table_name -> merge_msg_table_name(Prev, New, TrUserData);
        affected_rows -> merge_msg_affected_rows(Prev, New, TrUserData);
        metrics -> merge_msg_metrics(Prev, New, TrUserData);
        expire_after -> merge_msg_expire_after(Prev, New, TrUserData);
        eval_interval -> merge_msg_eval_interval(Prev, New, TrUserData);
        flight_metadata -> merge_msg_flight_metadata(Prev, New, TrUserData);
        interval_month_day_nano -> merge_msg_interval_month_day_nano(Prev, New, TrUserData);
        time_range -> merge_msg_time_range(Prev, New, TrUserData);
        time_ranges -> merge_msg_time_ranges(Prev, New, TrUserData);
        decimal_128 -> merge_msg_decimal_128(Prev, New, TrUserData);
        struct_field -> merge_msg_struct_field(Prev, New, TrUserData);
        column_data_type_extension -> merge_msg_column_data_type_extension(Prev, New, TrUserData);
        decimal_type_extension -> merge_msg_decimal_type_extension(Prev, New, TrUserData);
        vector_type_extension -> merge_msg_vector_type_extension(Prev, New, TrUserData);
        list_type_extension -> merge_msg_list_type_extension(Prev, New, TrUserData);
        struct_type_extension -> merge_msg_struct_type_extension(Prev, New, TrUserData);
        column_options -> merge_msg_column_options(Prev, New, TrUserData);
        arrow_ipc -> merge_msg_arrow_ipc(Prev, New, TrUserData)
    end.

