merge_msg_rows(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
             {#{schema := PFschema}, #{schema := NFschema}} -> S1#{schema => 'erlang_++'(PFschema, NFschema, TrUserData)};
             {_, #{schema := NFschema}} -> S1#{schema => NFschema};
             {#{schema := PFschema}, _} -> S1#{schema => PFschema};
             {_, _} -> S1
         end,
    case {PMsg, NMsg} of
        {#{rows := PFrows}, #{rows := NFrows}} -> S2#{rows => 'erlang_++'(PFrows, NFrows, TrUserData)};
        {_, #{rows := NFrows}} -> S2#{rows => NFrows};
        {#{rows := PFrows}, _} -> S2#{rows => PFrows};
        {_, _} -> S2
