verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        rows -> v_msg_rows(Msg, [MsgName], TrUserData);
        column_schema -> v_msg_column_schema(Msg, [MsgName], TrUserData);
        row -> v_msg_row(Msg, [MsgName], TrUserData);
        value -> v_msg_value(Msg, [MsgName], TrUserData);
        list_value -> v_msg_list_value(Msg, [MsgName], TrUserData);
        struct_value -> v_msg_struct_value(Msg, [MsgName], TrUserData);
        query_context -> v_msg_query_context(Msg, [MsgName], TrUserData);
        snapshot_sequences -> v_msg_snapshot_sequences(Msg, [MsgName], TrUserData);
        explain_options -> v_msg_explain_options(Msg, [MsgName], TrUserData);
        request_header -> v_msg_request_header(Msg, [MsgName], TrUserData);
        response_header -> v_msg_response_header(Msg, [MsgName], TrUserData);
        status -> v_msg_status(Msg, [MsgName], TrUserData);
        auth_header -> v_msg_auth_header(Msg, [MsgName], TrUserData);
        basic -> v_msg_basic(Msg, [MsgName], TrUserData);
        token -> v_msg_token(Msg, [MsgName], TrUserData);
        table_name -> v_msg_table_name(Msg, [MsgName], TrUserData);
        affected_rows -> v_msg_affected_rows(Msg, [MsgName], TrUserData);
        metrics -> v_msg_metrics(Msg, [MsgName], TrUserData);
        expire_after -> v_msg_expire_after(Msg, [MsgName], TrUserData);
        eval_interval -> v_msg_eval_interval(Msg, [MsgName], TrUserData);
        flight_metadata -> v_msg_flight_metadata(Msg, [MsgName], TrUserData);
        interval_month_day_nano -> v_msg_interval_month_day_nano(Msg, [MsgName], TrUserData);
        time_range -> v_msg_time_range(Msg, [MsgName], TrUserData);
        time_ranges -> v_msg_time_ranges(Msg, [MsgName], TrUserData);
        decimal_128 -> v_msg_decimal_128(Msg, [MsgName], TrUserData);
        struct_field -> v_msg_struct_field(Msg, [MsgName], TrUserData);
        column_data_type_extension -> v_msg_column_data_type_extension(Msg, [MsgName], TrUserData);
        decimal_type_extension -> v_msg_decimal_type_extension(Msg, [MsgName], TrUserData);
        vector_type_extension -> v_msg_vector_type_extension(Msg, [MsgName], TrUserData);
        list_type_extension -> v_msg_list_type_extension(Msg, [MsgName], TrUserData);
        struct_type_extension -> v_msg_struct_type_extension(Msg, [MsgName], TrUserData);
        column_options -> v_msg_column_options(Msg, [MsgName], TrUserData);
        arrow_ipc -> v_msg_arrow_ipc(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_rows/3}).
-dialyzer({nowarn_function,v_msg_rows/3}).
v_msg_rows(#{} = M, Path, TrUserData) ->
    case M of
        #{schema := F1} ->
            if is_list(F1) ->
                   _ = [v_submsg_column_schema(Elem, [schema | Path], TrUserData) || Elem <- F1],
                   ok;
               true -> mk_type_error({invalid_list_of, {msg, column_schema}}, F1, [schema | Path])
            end;
        _ -> ok
    end,
    case M of
        #{rows := F2} ->
            if is_list(F2) ->
                   _ = [v_submsg_row(Elem, [rows | Path], TrUserData) || Elem <- F2],
                   ok;
               true -> mk_type_error({invalid_list_of, {msg, row}}, F2, [rows | Path])
            end;
        _ -> ok
    end,
    lists:foreach(fun (schema) -> ok;
                      (rows) -> ok;
                      (OtherKey) -> mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_rows(M, Path, _TrUserData) when is_map(M) -> mk_type_error({missing_fields, [] -- maps:keys(M), rows}, M, Path);
v_msg_rows(X, Path, _TrUserData) -> mk_type_error({expected_msg, rows}, X, Path).

